describe("nham24supperapp", () => {
  it("test", async () => {
    // find element by accessibility id
    const NHAM24APP = await $('~NHAM24-DEV');
    // // click on element 
    // // Login app
    await NHAM24APP.click();
    await driver.pause(8000);
    // find element by x-path
    await $('//android.widget.TextView[@text="YOUR LOCATION"]').click();
    await $('//android.widget.TextView[@text="WORK"]').click();
    await $('//android.view.ViewGroup[@content-desc="FOOD"]/android.widget.LinearLayout/android.widget.FrameLayout/android.widget.ImageView').click();
    await driver.pause(5000);
    // scrolling 
    await driver.performActions([{
      type: "pointer",
      id: "finger1",
      parameters: {
        pointerType: "touch"
      },
      actions: [{
        type: "pointerMove",
        duration: 0,
        x: 902,
        y: 1949
      }, {
        type: "pointerDown",
